import React, { useState, useEffect } from 'react'
import axios from 'axios'
import { Link } from 'react-router-dom'

const MarvelCharacters = () => {
  const [marvelCharactersList, setMarvelCharactersList] = useState([])

  useEffect(async () => {
    const result = await axios(
      `https://gateway.marvel.com:443/v1/public/characters?apikey=d1925cd3b431b62ac236c00d3c681015`
    )
    console.log(result.data)
    setMarvelCharactersList(result.data.data.results)
  }, [])

  return (
    <ul>
      {marvelCharactersList.map(item => (
        <li key={item.name}>
          <p>{item.name}</p>
          <Link to={`/detail/${item.id}`}>{item.name}</Link>
          <p>{item.description}</p>
          <img src={item.thumbnail.path + '.' + item.thumbnail.extension}></img>
        </li>
      ))}
    </ul>
  )
}

export default MarvelCharacters
